// src/components/MemberJourney.jsx
import React, { useEffect, useState, useMemo } from 'react';
import { eventAPI } from '../api';
import LoadingState from './LoadingState';

export default function MemberJourney() {
  const [journey, setJourney] = useState([]);     // raw array from API
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    let mounted = true;
    eventAPI.getJourney()
      .then(res => {
        const data = Array.isArray(res.data) ? res.data : [];
        if (mounted) setJourney(data);
      })
      .catch(err => {
        console.error(err);
        if (mounted) setError('Failed to load journey');
      })
      .finally(() => mounted && setLoading(false));
    return () => { mounted = false; };
  }, []);

  const totals = useMemo(() => {
    const msg = journey.reduce((acc, ep) => acc + (ep?.metrics?.messages || 0), 0);
    const dec = journey.reduce((acc, ep) => acc + (ep?.metrics?.decisions || 0), 0);
    return { messages: msg, decisions: dec, episodes: journey.length };
  }, [journey]);

  if (loading) return <LoadingState label="Loading journey..." />;
  if (error)   return <div style={{ color: 'crimson' }}>{error}</div>;
  if (!journey || journey.length === 0) {
    return <div>No journey data available.</div>;
  }

  return (
    <div style={{ display: 'grid', gap: 16 }}>
      {/* Summary Bar */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gap: 12
      }}>
        <StatCard title="Episodes" value={totals.episodes} />
        <StatCard title="Messages" value={totals.messages} />
        <StatCard title="Decisions" value={totals.decisions} />
      </div>

      {/* Episodes */}
      {journey.map((ep, idx) => (
        <div key={idx} style={{
          border: '1px solid #eee',
          borderRadius: 12,
          padding: 16,
          background: 'white'
        }}>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'baseline', gap: 12, flexWrap: 'wrap' }}>
            <div>
              <h3 style={{ margin: 0 }}>{ep?.episode || 'Episode'}</h3>
              <div style={{ color: '#666', fontSize: 14 }}>Month {ep?.month ?? '-'}</div>
            </div>
            <div style={{ display: 'flex', gap: 12 }}>
              <Chip>{(ep?.metrics?.messages ?? 0)} msg</Chip>
              <Chip tone="blue">{(ep?.metrics?.decisions ?? 0)} decisions</Chip>
            </div>
          </div>

          {/* Conversations */}
          <div style={{ marginTop: 12, display: 'grid', gap: 8 }}>
            {(ep?.conversations ?? []).map((c, i) => (
              <div key={i} style={{
                background: '#fafafa',
                border: '1px solid #f0f0f0',
                borderRadius: 8,
                padding: 12
              }}>
                <div style={{ display: 'flex', justifyContent: 'space-between', gap: 8, flexWrap: 'wrap' }}>
                  <div>
                    <strong>{c?.sender || 'Unknown'}</strong>
                    <span style={{ marginLeft: 8, color: '#777', fontSize: 12 }}>
                      {c?.role ? `(${c.role})` : ''}
                    </span>
                  </div>
                  <div style={{ color: '#999', fontSize: 12 }}>
                    {c?.timestamp || ''}
                  </div>
                </div>
                <div style={{ marginTop: 6 }}>
                  <span style={{ fontSize: 12, padding: '2px 8px', borderRadius: 999, background: '#eef2ff', color: '#3730a3' }}>
                    {c?.topic || 'General'}
                  </span>
                </div>
                <p style={{ marginTop: 8, marginBottom: 0 }}>
                  {c?.message || ''}
                </p>
                {c?.action_decision ? (
                  <div style={{ marginTop: 8, fontSize: 12, color: '#065f46' }}>
                    âœ… Action/Decision
                  </div>
                ) : null}
              </div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
}

function StatCard({ title, value }) {
  return (
    <div style={{
      background: 'white',
      border: '1px solid #eee',
      borderRadius: 12,
      padding: 16,
      textAlign: 'center'
    }}>
      <div style={{ fontSize: 12, color: '#666' }}>{title}</div>
      <div style={{ fontSize: 24, fontWeight: 700 }}>{value}</div>
    </div>
  );
}

function Chip({ children, tone = 'gray' }) {
  const colors = {
    gray: { bg: '#f3f4f6', color: '#111827', border: '#e5e7eb' },
    blue: { bg: '#eff6ff', color: '#1e40af', border: '#dbeafe' },
  }[tone] || { bg: '#f3f4f6', color: '#111827', border: '#e5e7eb' };

  return (
    <span style={{
      fontSize: 12,
      padding: '4px 10px',
      borderRadius: 999,
      background: colors.bg,
      color: colors.color,
      border: `1px solid ${colors.border}`
    }}>
      {children}
    </span>
  );
}
